import React from 'react'
import './App.css'
import Theme from './Theme'
import gallery from './images/gallery.png';
import pinkcloud from './images/pinkcloud.png';



const Gallery = () => {
    return(
        <div id='gallery'>
            <Theme titleBoxStyle='gallery-title-box' titleStyle='gallery-title'  titleValue='CLOUD GALLERY'/>
            <p>A collection of my personal pick of artworks used for this website. </p>
            <Photo src={pinkcloud}  alt='pinkcloud' credit='Ian Fisher https://www.ianfisherart.com/gallery/painting'    />
        </div>
    );

}


const Photo = (props) => {
    return(
        <div>
            <img src={props.src} alt={props.name}></img>
            <span>'Credit: '{props.credit}</span>
        </div>
    );
}
export default Gallery;
